import   logo from './Images/thestory.jpg';
import './work.css';


function Work(){
    return(<div>

        <section >

            <div >
            <h1>
                The Story
            </h1>
            <img className="the-story"  src={logo} alt="React Logo" />

            </div>
        
       

         
        </section>

    </div>)
}

export default Work;
